import NavLinks from './NavLinks'

const Navigation = () => {
    return (
        <div className='Navigation'>
            <Link
                activeClass="active"
                to="about"
                spy={true}
                smooth={true}
                offset={-100}
                duration={500}
                className="nav-link">About</Link>
            <NavLinks />
        </div>
    );
}

export default Navigation;
